  //       <form className="container border p-4 mb-5 w-75">
  //         <div className="mb-3">
  //           <label className="form-label">
  //             Email address
  //           </label>
  //           <input
  //             type="email"
  //             className="form-control"
  //           />
  //         </div>
  //         <div className="mb-3">
  //           <label className="form-label">
  //             Password
  //           </label>
  //           <input
  //             type="password"
  //             className="form-control"
  //           />
  //         </div>
  //         <div className="button text-center pt-1">
  //           <button type="submit" className="btn">
  //             LOG IN
  //           </button>
  //         </div>

  //         <hr />

  //         <div className="text-center mt-3">
  //           <p>
  //             Don't have an account yet?{" "}
  //             <Link to="/signup" className="text-danger">
  //               Sign Up
  //             </Link>
  //           </p>
  //         </div>
  //       </form>
  //     </div>
  //   </div>
  // );
  return (
    <div class="account-login section">
      <div class="container">
        <div class="row">
          <div class="col-lg-6 offset-lg-3 col-md-10 offset-md-1 col-12">
            <form class="card login-form" method="post">
              <div class="card-body">
                <div class="title">
                  <h3>Login Now</h3>
                  <p>
                    You can login using your social media account or email
                    address.
                  </p>
                </div>
                <div class="social-login">
                  <div class="row">
                    <div class="col-lg-4 col-md-4 col-12">
                      <a class="btn facebook-btn" href="javascript:void(0)">
                        <i class="lni lni-facebook-filled"></i> Facebook login
                      </a>
                    </div>
                    <div class="col-lg-4 col-md-4 col-12">
                      <a class="btn twitter-btn" href="javascript:void(0)">
                        <i class="lni lni-twitter-original"></i> Twitter login
                      </a>
                    </div>
                    <div class="col-lg-4 col-md-4 col-12">
                      <a class="btn google-btn" href="javascript:void(0)">
                        <i class="lni lni-google"></i> Google login
                      </a>
                    </div>
                  </div>
                </div>
                <div class="alt-option">
                  <span>Or</span>
                </div>
                <div class="form-group input-group">
                  <label for="reg-fn">Email</label>
                  <input
                    class="form-control"
                    type="email"
                    id="reg-email"
                    required
                  />
                </div>
                <div class="form-group input-group">
                  <label for="reg-fn">Password</label>
                  <input
                    class="form-control"
                    type="password"
                    id="reg-pass"
                    required
                  />
                </div>
                <div class="d-flex flex-wrap justify-content-between bottom-content">
                  <div class="form-check">
                    <input
                      type="checkbox"
                      class="form-check-input width-auto"
                      id="exampleCheck1"
                    />
                    <label class="form-check-label">Remember me</label>
                  </div>
                  <a class="lost-pass" href="account-password-recovery.html">
                    Forgot password?
                  </a>
                </div>
                <div class="button">
                  <button class="btn" type="submit">
                    Login
                  </button>
                </div>
                <p class="outer-link">
                  Don't have an account?{" "}
                  <a href="register.html">Register here </a>
                </p>
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
